from itertools import permutations
from typing import List

def findSubstring(s: str, words: List[str]) -> List[int]:
    if not s or not words:
        return []
    rst = []
    perms = permutations(words)
    perms_strings = [''.join(perm) for perm in perms]
    for i in perms_strings:
        st = 0
        while st <= len(s) - len(i):
            st = s.find(i,st)
            if st == -1:
                break
            rst.append(st)
            st +=1
    s1 = set(rst)
    return sorted(list(s1))
s = ""
words = ["dhvf","sind","ffsl","yekr","zwzq","kpeo","cila","tfty","modg","ztjg","ybty","heqg","cpwo","gdcj","lnle","sefg","vimw","bxcb"]

# s = "wordgoodgoodgoodbestword"
# words = ["word","good","best","word"]

print(findSubstring(s,words))